import { Flex, Button } from "@chakra-ui/react";
import igmg_logo from './assets/igmg_logo.png';
import TabButton from './components/TabButton';

export function MenuBar() {
    return (
        <Flex className="MenuBar" width="full" alignItems="center" justifyContent="space-between" padding="10px" backgroundColor="lightgray">
            {/* Flex-Container f√ºr die TabButtons */}
            <Flex flexGrow={3} justifyContent="space-around">
                <TabButton>
                    Home
                </TabButton>
                <TabButton>
                    About
                </TabButton>
            </Flex>

            {/* Logo */}
            <Flex flexGrow={1}>
                <img src={igmg_logo} className="App-logo" alt="logo" style={{ width: '100%', height: 'auto' }} />
            </Flex>
        </Flex>
    );
}
